import React from "react";
import AppLayout from "../components/AppLayout";
import { Button, Calendar, Col, Row } from 'antd';
import MyInfo from "../components/myInfo";
import './css/profile.module.css';
import Mention from "../components/mention";
import LikeList from "../components/likeList";
import Followers from "../components/followers";
import Followings from "../components/followings";
import Card from "antd/lib/card/Card";
import Login from "./login";
import { useSelector } from "react-redux";
import Link from "next/link";

const Profile = () => {

    const {singlePost} = useSelector((state) => state.post);

    const renderPhoto = (eventInfo) => {
        return(
        <div >
            {/* <p>{eventInfo.event.title}</p> */}
            <Link to='#'>
                <img className="eventimage" src={`http://localhost:3065/${singlePost.Images.src}`} style={{width: "100px", height:"150px"}} alt=""/>
            </Link>
        </div>
        );
    };

    

 return(
    <div style={{position: 'relative',width: 1250}}>
       
        
       <section style={{marginTop: '50px'}}>
           <Row><h1 style={{}}>MY Profile</h1></Row>
           <Row><Button href="/newLook" style={{backgroundColor: 'black', color: 'white'}}>오늘의 데일리룩 만들기</Button></Row>
       <Row>
       <div style={{float: 'left'}}>
           <Card>
           <Calendar
            style={{width: '600px', height: '893px', float: 'left'}}  
            mode='month' 
           dateCellRender={renderPhoto}
            />
           {/* <FullCalendar /> */}

           </Card>
       </div>
       <div style={{float: 'left'}}>
       <MyInfo /> 
        <Mention />
       </div>
       </Row>
       <Row style={{marginTop: 15}}>
           <LikeList />
           <Followers  />
           <Followings  />   
           <a style={{marginLeft: 30, marginTop: 50}} href="/profileMore"><h2>+More</h2></a>
       </Row>  
       </section>
       </div>
       

 );
};

export default Profile;
